import React from 'react';
import {AppBar, Button, Toolbar} from '@material-ui/core';
import './Footer.css';

class Footer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {};
    }

    render() {
        return (
          <div>
                <br/><hr/>
                <div>Designed by Lucas Pao</div>

                    <a href="https://github.com/lucaspingpao" target="_blank" style={{ textDecoration: 'none' }}><Button color="primary">Github</Button></a>
                    <a href="https://www.youtube.com/channel/UCm0a7WR5C2684z6fL5XNodw" target="_blank" style={{ textDecoration: 'none' }}><Button color="primary">YouTube</Button></a>
                <hr/><br/>
          </div>
        );
    }
}

export default Footer;
